export const ProductList = () => {
    const [Products, setProducts] = React.useState([]);
    console.log(Products);

    useEffect(() => {
        fetch('http://localhost:8000/products')
            .then(response => response.json())
            .then(data => setProducts(data));
    }, []);

  return (
    <div>ProductList</div>
  )
}
